import '../styles/skills.css';

import reactIcon from "../images/linkedin-icon.png";
import htmlIcon from "../images/github-icon.png";
import cssIcon from "../images/email-icon.png";
import javaIcon from "../images/linkedin-icon.png";
import pythonIcon from "../images/github-icon.png";
import typeScriptIcon from "../images/email-icon.png";

function Skills() {
  return (
    <>
        <div class="title">SKILLS</div>
        <div class="skill-section">
            <div class="row">
            <div>
                <div class="linkedin">
                    <img src={linkedinIcon} class="icon"></img>
                </div>
                <div class="skill-name"></div>
            </div>

            </div>
            <div class="row">

            </div>
            <div class="row">

            </div>
        </div>
    </>
  );
}

export default Skills;
